


CREATE TABLE Turistas(
  idTuristas INT NOT NULL PRIMARY KEY,
  userName VARCHAR(45) NOT NULL,
  email VARCHAR(45) NOT NULL,
  password VARCHAR(255) NOT NULL);

CREATE TABLE Guias (
  idGuia INT NOT NULL PRIMARY KEY,
  userName VARCHAR(45) NOT NULL,
  email VARCHAR(45) NOT NULL,
  password VARCHAR(255) NOT NULL);
  
CREATE TABLE Rutas (
  idRutas INT NOT NULL PRIMARY KEY,
  nombre VARCHAR(45) NOT NULL,
  fechaCreacion DATE NOT NULL,
  precio FLOAT NOT NULL,
  tipoRuta VARCHAR(45) NOT NULL,
  guia INT NOT NULL,
  constraint fk_rutas_guias foreign key (guia) references Guias(idGuia));

CREATE TABLE Compras (
  idCompras INT NOT NULL PRIMARY KEY,
  turista INT NOT NULL,
  fecha VARCHAR(45) NOT NULL,
  ruta INT NOT NULL,
  constraint fk_compras_turistas foreign key (turista) references Turistas(idTuristas),
  constraint fk_compras_rutas foreign key (ruta) references Rutas(idRutas));

CREATE TABLE  PuntosDeInteres (
  idpuntosDeInteres INT NOT NULL PRIMARY KEY,
  descripcion  VARCHAR(255) NOT NULL,
  foto VARCHAR(2000) NULL,
  latitud FLOAT NOT NULL,
  longitud FLOAT NOT NULL,
  ruta INT NOT NULL,
  tipoPunto VARCHAR(45) NOT NULL,
  constraint fk_puntos_de_interes_rutas foreign key (ruta) references Rutas(idRutas));
  
CREATE TABLE Valoraciones (
  idValoraciones INT NOT NULL PRIMARY KEY,
  nota INT NOT NULL,
  turista INT NOT NULL,
  ruta INT NOT NULL,
  constraint fk_valoraciones_rutas foreign key (ruta) references Rutas(idRutas),
  constraint fk_valoraciones_turista foreign key (turista) references Turistas(idTuristas));
 






